import React from 'react';
import { generateId } from '@collab/shared';

function App() {
  const userId = generateId();

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1>Collaborative Code Editor</h1>
      <p>User ID: {userId}</p>
      <p>Ready to connect to Socket.IO server...</p>
    </div>
  );
}

export default App;
